import React from 'react'
import ReactDOM from 'react-dom'

const Hello = () => {
  const hello = "hello"
  const world = "world"
  return (
    <div>
      <p>{hello} + " " + {world}</p>
    </div>
  )
}

const App = () => {
  const now = new Date()
  const a = 10
  const b = 20
  return (
    <div>
      <h1>Greetings!</h1>
      <Hello />
      <p>
        {a} plus {b} is {a + b}
      </p>
      <p>
        The Time is now {now.toString()}
      </p>
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
